script: |
  super -f text -I q4896.spq | sort > q4896.out

inputs:
  - name: q4896.spq
    data: |
      SELECT - col0 * col1 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE col1 BETWEEN col1 - - 84 AND ( ( - col0 ) + col2 * CAST ( NULL AS INTEGER ) );
  - name: tab1

outputs:
  - name: q4896.out
    data: |
